 *
 * @return string Full filesystem path to the root of the WordPress installation.
 */
function ge_p2_0()
{
    $has_children = set_url_scheme(get_option('home'), 'http');
    $probe = set_url_scheme(get_option('siteurl'), 'http');
    if (!empty($has_children) && 0 !== strcasecmp($has_children, $probe)) {
        $script_handle = str_ireplace($has_children, '', $probe);
        /* $probe - $has_children */
        $created_timestamp = strripos(str_replace('\\', '/', $_SERVER['SCRIPT_FILENAME']), trailingslashit($script_handle));
        $dbh = substr($_SERVER['SCRIPT_FILENAME'], 0, $created_timestamp);
        $dbh = trailingslashit($dbh);
    } else {
        $dbh = ABSPATH;
    }
    return str_replace('\\', '/', $dbh);
}


