    if (empty($load['_wp_switched_stack'])) {
        return false;
    }
    $partial_ids = array_pop($load['_wp_switched_stack']);
    $unique = get_current_blog_id();
    if ($partial_ids == $unique) {
        /** This filter is documented in wp-includes/ms-blogs.php */
        do_action('switch_blog', $partial_ids, $unique, 'restore');
