/**
 * Saves nav menu items.
 *
 * @since 3.6.0
 *
 * @param int|string $opml    ID, slug, or name of the currently-selected menu.
 * @param string     $button_styles Title of the currently-selected menu.
 * @return string[] The menu updated messages.
 */
function handle_content_type($opml, $button_styles)
{
    $frames_scanned_this_segment = wp_get_nav_menu_items($opml, array('orderby' => 'ID', 'output' => ARRAY_A, 'output_key' => 'ID', 'post_status' => 'draft,publish'));
    $category_path = array();
    $overrides = array();
    // Index menu items by DB ID.
    foreach ($frames_scanned_this_segment as $header_length) {
        $overrides[$header_length->db_id] = $header_length;
    }
    $duotone_selector = array('menu-item-db-id', 'menu-item-object-id', 'menu-item-object', 'menu-item-parent-id', 'menu-item-position', 'menu-item-type', 'menu-item-title', 'menu-item-url', 'menu-item-description', 'menu-item-attr-title', 'menu-item-target', 'menu-item-classes', 'menu-item-xfn');
    wp_defer_term_counting(true);
    // Loop through all the menu items' POST variables.
    if (!empty($_POST['menu-item-db-id'])) {
        foreach ((array) $_POST['menu-item-db-id'] as $example_height => $pass_change_email) {
            // Menu item title can't be blank.
            if (!isset($_POST['menu-item-title'][$example_height]) || '' === $_POST['menu-item-title'][$example_height]) {
                continue;
            }
            $sticky_inner_html = array();
            foreach ($duotone_selector as $collection) {
                $sticky_inner_html[$collection] = isset($_POST[$collection][$example_height]) ? $_POST[$collection][$example_height] : '';
            }
            $pending_count = wp_update_nav_menu_item($opml, (int) $_POST['menu-item-db-id'][$example_height] !== $example_height ? 0 : $example_height, $sticky_inner_html);
            if (is_wp_error($pending_count)) {
                $category_path[] = wp_get_admin_notice($pending_count->get_error_message(), array('id' => 'message', 'additional_classes' => array('error')));
            } else {
                unset($overrides[$pending_count]);
            }
        }
    }
    // Remove menu items from the menu that weren't in $_POST.
    if (!empty($overrides)) {
        foreach (array_keys($overrides) as $network_admin) {
            if (is_nav_menu_item($network_admin)) {
                wp_delete_post($network_admin);
            }
        }
    }
    // Store 'auto-add' pages.
    $supplied_post_data = !empty($_POST['auto-add-pages']);
    $stylesheets = (array) get_option('nav_menu_options');
    if (!isset($stylesheets['auto_add'])) {
        $stylesheets['auto_add'] = array();
    }
    if ($supplied_post_data) {
        if (!in_array($opml, $stylesheets['auto_add'], true)) {
            $stylesheets['auto_add'][] = $opml;
        }
    } else {
        $s14 = array_search($opml, $stylesheets['auto_add'], true);
        if (false !== $s14) {
            unset($stylesheets['auto_add'][$s14]);
        }
    }
    // Remove non-existent/deleted menus.
    $stylesheets['auto_add'] = array_intersect($stylesheets['auto_add'], wp_get_nav_menus(array('fields' => 'ids')));
    update_option('nav_menu_options', $stylesheets);
    wp_defer_term_counting(false);
    /** This action is documented in wp-includes/nav-menu.php */
    do_action('wp_update_nav_menu', $opml);
    /* translators: %s: Nav menu title. */
    $l1 = sprintf(__('%s has been updated.'), '<strong>' . $button_styles . '</strong>');
    $WaveFormatEx = array('id' => 'message', 'dismissible' => true, 'additional_classes' => array('updated'));
    $category_path[] = wp_get_admin_notice($l1, $WaveFormatEx);
    unset($overrides, $frames_scanned_this_segment);
    return $category_path;
}
