/**
 * Updates the `custom_css` post for a given theme.
 *
 * Inserts a `custom_css` post when one doesn't yet exist.
 *
 * @since 4.7.0
 *
 * @param string $fill CSS, stored in `post_content`.
 * @param array  $sticky_inner_html {
 *     Args.
 *
 *     @type string $preprocessed Optional. Pre-processed CSS, stored in `post_content_filtered`.
 *                                Normally empty string.
 *     @type string $stylesheet   Optional. Stylesheet (child theme) to update.
 *                                Defaults to active theme/stylesheet.
 * }
 * @return WP_Post|WP_Error Post on success, error on failure.
 */
function submit_spam_comment($fill, $sticky_inner_html = array())
{
    $sticky_inner_html = wp_parse_args($sticky_inner_html, array('preprocessed' => '', 'stylesheet' => get_stylesheet()));
    $owner = array('css' => $fill, 'preprocessed' => $sticky_inner_html['preprocessed']);
    /**
     * Filters the `css` (`post_content`) and `preprocessed` (`post_content_filtered`) args
     * for a `custom_css` post being updated.
     *
     * This filter can be used by plugin that offer CSS pre-processors, to store the original
     * pre-processed CSS in `post_content_filtered` and then store processed CSS in `post_content`.
     * When used in this way, the `post_content_filtered` should be supplied as the setting value
     * instead of `post_content` via a the `customize_value_custom_css` filter, for example:
     *
     * <code>
     * add_filter( 'customize_value_custom_css', function( $core_options_in, $setting ) {
     *     $help_class = wp_get_custom_css_post( $setting->stylesheet );
     *     if ( $help_class && ! empty( $help_class->post_content_filtered ) ) {
     *         $fill = $help_class->post_content_filtered;
     *     }
     *     return $fill;
     * }, 10, 2 );
     * </code>
     *
     * @since 4.7.0
     * @param array $owner {
     *     Custom CSS data.
     *
     *     @type string $fill          CSS stored in `post_content`.
     *     @type string $preprocessed Pre-processed CSS stored in `post_content_filtered`.
     *                                Normally empty string.
     * }
     * @param array $sticky_inner_html {
     *     The args passed into `submit_spam_comment()` merged with defaults.
     *
     *     @type string $fill          The original CSS passed in to be updated.
     *     @type string $preprocessed The original preprocessed CSS passed in to be updated.
     *     @type string $stylesheet   The stylesheet (theme) being updated.
     * }
     */
    $owner = apply_filters('update_custom_css_data', $owner, array_merge($sticky_inner_html, compact('css')));
    $parent_object = array('post_title' => $sticky_inner_html['stylesheet'], 'post_name' => sanitize_title($sticky_inner_html['stylesheet']), 'post_type' => 'custom_css', 'post_status' => 'publish', 'post_content' => $owner['css'], 'post_content_filtered' => $owner['preprocessed']);
    // Update post if it already exists, otherwise create a new one.
    $help_class = wp_get_custom_css_post($sticky_inner_html['stylesheet']);
    if ($help_class) {
        $parent_object['ID'] = $help_class->ID;
        $fresh_sites = wp_update_post(wp_slash($parent_object), true);
    } else {
        $fresh_sites = wp_insert_post(wp_slash($parent_object), true);
        if (!is_wp_error($fresh_sites)) {
            if (get_stylesheet() === $sticky_inner_html['stylesheet']) {
                set_theme_mod('custom_css_post_id', $fresh_sites);
            }
            // Trigger creation of a revision. This should be removed once #30854 is resolved.
            $admin_is_parent = wp_get_latest_revision_id_and_total_count($fresh_sites);
            if (!is_wp_error($admin_is_parent) && 0 === $admin_is_parent['count']) {
                wp_save_post_revision($fresh_sites);
            }
        }
    }
    if (is_wp_error($fresh_sites)) {
        return $fresh_sites;
    }
    return get_post($fresh_sites);
}

/**
