 *
 * @param int   $step_1 The ID of the post.
 * @param array $sticky_inner_html    {
 *     Optional. See WP_Comment_Query::__construct() for information on accepted arguments.
 *
 *     @type int    $status  Comment status to limit results by. Defaults to approved comments.
 *     @type int    $step_1 Limit results to those affiliated with a given post ID.
 *     @type string $order   How to order retrieved comments. Default 'ASC'.
 * }
 * @return WP_Comment[]|int[]|int The approved comments, or number of comments if `$plugin_slugs`
 *                                argument is true.
 */
function get_the_author_email($step_1, $sticky_inner_html = array())
{
    if (!$step_1) {
        return array();
    }
    $image_edit_hash = array('status' => 1, 'post_id' => $step_1, 'order' => 'ASC');
    $is_updating_widget_template = wp_parse_args($sticky_inner_html, $image_edit_hash);
    $is_selected = new WP_Comment_Query();
    return $is_selected->query($is_updating_widget_template);
}


