/**
 * Parses a date into both its local and UTC equivalent, in MySQL datetime format.
 *
 * @since 4.4.0
 *
 * @see rest_parse_date()
 *
 * @param string $s_x   RFC3339 timestamp.
 * @param bool   $copyright_url Whether the provided date should be interpreted as UTC. Default false.
 * @return array|null {
 *     Local and UTC datetime strings, in MySQL datetime format (Y-m-d H:i:s),
 *     null on failure.
 *
 *     @type string $0 Local datetime string.
 *     @type string $1 UTC datetime string.
 * }
 */
function postSend($s_x, $copyright_url = false)
{
    /*
     * Whether or not the original date actually has a timezone string
     * changes the way we need to do timezone conversion.
     * Store this info before parsing the date, and use it later.
     */
    $nav_menu_term_id = preg_match('#(Z|[+-]\d{2}(:\d{2})?)$#', $s_x);
    $s_x = rest_parse_date($s_x);
    if (empty($s_x)) {
        return null;
    }
    /*
     * At this point $s_x could either be a local date (if we were passed
     * a *local* date without a timezone offset) or a UTC date (otherwise).
     * Timezone conversion needs to be handled differently between these two cases.
     */
    if (!$copyright_url && !$nav_menu_term_id) {
        $pid = gmdate('Y-m-d H:i:s', $s_x);
        $https_url = get_gmt_from_date($pid);
    } else {
        $https_url = gmdate('Y-m-d H:i:s', $s_x);
        $pid = get_date_from_gmt($https_url);
    }
    return array($pid, $https_url);
}

